import * as React from 'react';
import Box from '@mui/material/Box';
import { FitScreen, Maximize } from '@mui/icons-material';
import './AddClassBox.css';

export default function AddClassBox() {
  return (<>
    <Box
      my={4}
      display="flex"
      alignItems="center"
      gap={10}
      p={15}
      sx={{ height:FitScreen,border: '2px solid grey' }}
    >
      
    <div class="main-container">
        <div class="top-container">
            <div class="top-text">
                Class 1
            </div>
        </div>
        <div class="bottom-container"> 
            <div class="bottom-text">
                Professor
            </div>
        </div>
    </div>
    
    </Box>
    <Box
    my={4}
    display="flex"
    alignItems="center"
    gap={10}
    p={15}
    sx={{ height:100,border: '2px solid grey' }}
  >
    
  <div class="main-container">
      <div class="top-container">
          <div class="top-text">
              Class 1
          </div>
      </div>
      <div class="bottom-container"> 
          <div class="bottom-text">
              Professor
          </div>
      </div>
  </div>
  
  </Box>
  </>
  );
}
